import React from "react";
import devProfile from "../../resources/images/me and the mountain call.JPG";
const About = () => {
  return (
    <div className="container">
      <div class="d-flex justify-content-end">
        <img
          src={devProfile}
          alt=""
          className="rounded-circle"
          style={{ height: "35vh", width: "35vh" }}
        />
      </div>
      <div className="row">
        <div
          className="col-6 border border-5 py-5 my-5"
          style={{ borderColor: "black !important", height: "60vh" }}
        ></div>
        <div className="col-6">TEXT</div>
      </div>
    </div>
  );
};

export default About;
